Get flattened array of documents embedded in array with filter on document property in MongoDB<p>I have a MongoDb collection of documents each containing an array of embedded documents. I'd like to retrieve a flattened list of those embedded documents of which the date property is before a given date.</p>

<p>Let's assume we have the following classes:</p>

<pre><code>public class RootItem
{
    public string Id { get; set; }
    public string Name{ get; set; }
    public string PictureUrl { get; set; }
    public List&lt;Reservation&gt; Reservations { get; set; }
}

public class Reservation
{
    public string Name { get; set; }
    public DateTime Date{ get; set; }
    public int NrOfSeats { get; set; }
}
</code></pre>

<p>So the collection would look something like this:</p>

<pre><code>{
  "_id": "5be2bb2fdfd6174938518af2",
  "name": "John Doe",
  "pictureUrl": "http://example.com/abc.jpg",
  "reservations": [
    {
      "table": "abc",
      "date": "1/1/2019",
      "nrOfSeats": 5
    },
    {
      "name": "xyz",
      "date": "7/1/2019",
      "nrOfSeats": 5
    }
  ]
}
</code></pre>

<p>I've read the docs, I've read alot here at SO but the closest I got this far was this:</p>

<pre><code>var reservations = Collection
            .Aggregate()
            .Unwind&lt;RootItem, Reservation&gt;(x =&gt; x.Reservations)
            .ToList()
            .FindAll(r =&gt; r.Date &gt; thresholdDate);
</code></pre>

<p>Running this code I got this error: </p>

<p><em>System.FormatException: 'Element '_id' does not match any field or property of class 'Reservation'</em></p>

<p>So I add a projection. If I only exclude the <em>_id</em> field I get:</p>

<p><em>'Element 'Created' does not match any field or property of class 'Reservation'</em></p>

<p>So I manually include the other fields (should be unnecessary):</p>

<pre><code>var reservations = Collection
            .Aggregate()
            .Unwind&lt;RootItem, Reservation&gt;(x =&gt; x.Reservations)
            .Project&lt;Reservation&gt;(Builders&lt;Reservation&gt;.Projection
                 .Exclude("_id")
                 .Include(r =&gt; r.Name)
                 .Include(r =&gt; r.Date)
                 .Include(r =&gt; r.NrOfSeats))
            .ToList()
            .FindAll(r =&gt; r.Date &gt; thresholdDate);
</code></pre>

<p>But now I get a List with NrOfSeats and Name set to null and Date to 1/1/0001.</p>

<p>How can I retrieve a flattened list of all reservations in my collection of which the date property is before/smaller than a given date?</p>

