NodeJS with Mongoose - pragmatically add url to image retrieved with find()<p>I have the following Mongoose schema:</p>

<pre><code>var userSchema = new Schema({
    username: {
        type: String,
    },
    password: {
        type: String,
    },
    email: {
        type: String,
    },
    _imageId: [{
        type: mongoose.Schema.Types.ObjectId,
        ref: 'files'
    }]
});
</code></pre>

<p>When I retrieve data from the database using the function findOne() in this way</p>

<pre><code>getById: function (req, res) {
    User.findOne({ _id: req.params.id }, function (err, user) {
        getProfileImage(req, user, function(user) {
            return res.status(200).send({
                msg: 'User retrieved successfully',
                data: user
            });
        });
    });
}
</code></pre>

<p>I get an array of image, but only with their id, so I have to manually add the URL using the function getProfileImage.</p>

<p>Is there a way using Mongoose to pragmatically add the URL?</p>

<p>EDIT:</p>

<p>I add the implementation of getProfileImage</p>

<pre><code>var getProfileImage = function(req, user, callback) {
    if(user &amp;&amp; user._imageId.length &gt; 0) {
        user.set('profileImage', req.protocol + '://' + req.get('host') + '/image/get/' + user._imageId[user._imageId.length - 1], { strict: false });
    }

    callback(user);
};
</code></pre>

