How does mongoose.connect(connectionSring) work?<p>I come from a python background when connecting to databases and executing sql without an ORM.  Say with the python library <code>cx_Oracle</code>, like so:</p>

<pre><code>&gt;&gt;&gt; conn = cx_Oracle.connect(connectionString)
&gt;&gt;&gt; curs = conn.cursor()
&gt;&gt;&gt; _ = curs.execute(...)
</code></pre>

<p>More specifically, directing all of my calls to the database through the returned connection object <code>conn</code>, not the library <code>cx_Oracle</code> itself.</p>

<p>In an <code>express</code> app, using mongodb with <code>node.js</code> and <code>mongoose</code>, we might be doing something like:</p>

<pre><code>require('./models/user'); // Defines new Schema in mongoose named 'users'
require('./services/passport');  // receives data from OAuth flow
// and writes new authenticated users to MongoDB database

mongoose.connect(keys.mongoURI, {useNewUrlParser: true});

const app = express();
require('./routes/authRoutes')(app);  // handle OAuth routes and pass to passport authentication

// server runs and listens to routes etc
</code></pre>

<p>It seems like the imported library <code>mongoose</code> itself is getting set with new properties from:</p>

<pre><code>mongoose.connect(keys.mongoURI, {useNewUrlParser: true});
</code></pre>

<p>As subsequent calls like the below in <code>./services/passport.js</code> to create new users have no obvious reference to our connection.</p>

<pre><code>const User = mongoose.model('users');

// within an OAuth callback
new User({ id: response.data.id })
  .save()
  .then(...)
</code></pre>

<p>I've looked at the source for <code>Mongoose.prototype.connect</code> to understand this but am confused by the return statement.  After the promise is completed, it returns an arrow function with <code>_mongoose</code>, our instance of the prototype <code>Mongoose</code> itself with a new connection, yet we are not returning anything in our app.</p>

<pre><code>Mongoose.prototype.connect = function() {
  const _mongoose = this instanceof Mongoose ? this : mongoose;
  const conn = _mongoose.connection;
  return conn.openUri(arguments[0], arguments[1], arguments[2]).then(() =&gt; _mongoose);
};
</code></pre>

<p>Can someone please explain what is happening to our imported <code>mongoose</code> library when we call <code>mongoose.connect(...)</code>?  Or perhaps send some resources so I can see a simple example of this?  Thanks.</p>

