How to make $not regexp query work in Go?<p>I'm having trouble implementing non-full text exclude search with golang and mongodb. </p>

<p>It's work in mongo shell:</p>

<pre><code>db.collectionName.find({"comment":{"$not": /.*excludeThis.*/}})
</code></pre>

<p>It's don't work in Go:</p>

<pre><code>package main

import (
    "log"
    "regexp"

    "github.com/night-codes/mgo-wrapper"
    mgo "gopkg.in/mgo.v2"
)

type (


    SomeStruct struct {
            ID      uint64 `form:"id" json:"id" bson:"_id"`
            Name    string `form:"name" json:"name" bson:"name"`
            Comment string   `form:"comment" json:"comment" bson:"comment"`
        }

    collectionStruct struct {
        collection *mgo.Collection
    }

    obj map[string]interface{}
    arr []interface{}
)

var (
    some = collectionStruct{collection: mongo.DB("somedb").C("somecollection")}
)

func main() {
    re := regexp.MustCompile(".*" + "exclude" + ".*")
    query := obj{"comment": obj{"$not": re}}

    result := []SomeStruct{}
    if err := some.collection.Find(query).All(&amp;result); err != nil {
        log.Println("Error:", err)
        return
    }

    log.Println("Result:")
    for k := range result {
        log.Printf("%+v\n", result[k])
    }
    log.Println("-------")
}
</code></pre>

<p>I'm getting error: </p>

<blockquote>
  <p>Error: reflect.Value.Interface: cannot return value obtained from unexported field or method</p>
</blockquote>

<p>Is here any way to make regex work or implement it in other way?</p>

