How to access deeply nested array with MongoDB (ASP.NET Core 2.2)<p>I'm designing an inventory management system with MongoDB. I have the following database structure:</p>

<pre><code>inventory
└─storage_slots
└─storage_locations
...etc...
</code></pre>

<p>Every time a new <code>Slot</code> is added, a tree representing the slot's location in the hierarchy is added to the <code>storage_locations</code> collection to represent its location (according to location, room, section, shelf). So far I have managed to successfully add a new item where none of the location fields are already used: (The slot is also added to the <code>storage_slots</code> collection)</p>

<pre><code>{
"_id" : ObjectId("5c57169f0863d665c7f13d27"),
"CreatedUtc" : {
    "$date" : 1549211298017
},
"UpdatedUtc" : {
    "$date" : 1549211298017
},
"Description" : null,
"Address" : null,
"StorageRooms" : [
    {
        "_id" : ObjectId("5c57169f0863d665c7f13d28"),
        "CreatedUtc" : {
            "$date" : 1549211297719
        },
        "UpdatedUtc" : {
            "$date" : 1549211297719
        },
        "Description" : null,
        "StorageSections" : [
            {
                "_id" : ObjectId("5c57169f0863d665c7f13d29"),
                "CreatedUtc" : {
                    "$date" : 1549211297719
                },
                "UpdatedUtc" : {
                    "$date" : 1549211297719
                },
                "Description" : null,
                "StorageShelves" : [
                    {
                        "_id" : ObjectId("5c57169f0863d665c7f13d2a"),
                        "CreatedUtc" : {
                            "$date" : 1549211297719
                        },
                        "UpdatedUtc" : {
                            "$date" : 1549211297719
                        },
                        "Description" : null,
                        "StorageSlotIds" : [
                            ObjectId("5c57169f0863d665c7f13d26")
                        ]
                    }
                ]
            }
        ]
    }
]
}
</code></pre>

<p>To be clear, <code>storage_locations</code> is the above hierarchy while <code>storage_slots</code> is just a collection of slots.</p>

<p>However, if the fields are already present in the hierarchy, the following code is run: (I took insipration from <a href="https://stackoverflow.com/a/30737016/9431636">this</a> post)</p>

<pre><code>var filter = Builders&lt;StorageLocation&gt;.Filter.And(
            Builders&lt;StorageLocation&gt;.Filter.Where(location =&gt; location.Id == id),
            Builders&lt;StorageLocation&gt;.Filter.Eq("StorageRooms.Id", roomId),
            Builders&lt;StorageLocation&gt;.Filter.Eq("StorageRooms.$.StorageSections.Id", sectionId),
            Builders&lt;StorageLocation&gt;.Filter.Eq("StorageRooms.$.StorageSections.$.StorageShelves.Id", shelfId));
        var update =
            Builders&lt;StorageLocation&gt;.Update.Push("StorageRooms.$.StorageSections.$.StorageShelves.$.StorageSlotIds",
                storageSlotIds);
        return await UpdateAsync(filter, update, cancellationToken);
</code></pre>

<p>Also, if only some of them are defined then I do a mix of both that I decided not to show here because they are built on the same principles and would not contribute to the question.</p>

<h1>The problem</h1>

<p>Whenever the code directly above is run. I get the following error:</p>

<pre><code>InvalidCastException: Unable to cast object of type 'MongoDB.Bson.ObjectId[]' to type 'MongoDB.Bson.ObjectId'.

MongoDB.Bson.Serialization.Serializers.SerializerBase&lt;TValue&gt;.MongoDB.Bson.Serialization.IBsonSerializer.Serialize(BsonSerializationContext context, BsonSerializationArgs args, object value)

//annoying scrollbar
