Attempting to use aggregate $geoNear with Mongoose but receiving error: "Near field must be point"<p>I'm building an API using Express and Mongoose. I have a Reviews collection that has a location field which stores geoJSON. I'm attempting to query my Reviews collection using <strong>aggregate</strong> and <strong>$geoNear</strong>.</p>
<p>Here's the relevant portion from my ReviewSchema:</p>
<pre><code>location: { 
    type: { 
      type: String, 
      default: 'Point'
    },
    coordinates: { 
      type: [Number] 
    } 
  }
</code></pre>
<p>I also added a <strong>2dsphere</strong> index:</p>
<pre><code>ReviewSchema.index({ location: '2dsphere' });
</code></pre>
<p>I'm able to successfully query the collection using <strong>find</strong> and <strong>$nearSphere</strong>:</p>
<pre><code>router.get('/:longitude/:latitude/:dist', (req, res) =&gt; {
  Review.find({
    location: {
     $nearSphere: {
       $geometry: {
         type: 'Point',
         coordinates: [req.params.longitude, req.params.latitude]
       },
       $maxDistance: req.params.dist * 1609.34
     }
   }
  })
  .then(reviews =&gt; res.json(reviews))
});
</code></pre>
<p>When attempting to use aggregate and $geoNear however I get an error:</p>
<blockquote>
<p>near field must be point</p>
</blockquote>
<p>Here's the route with the query:</p>
<pre><code>router.get('/:longitude/:latitude', (req, res) =&gt; {
  Review.aggregate([{
     $geoNear: {
       near: {
         type: &quot;Point&quot;,
         coordinates: [req.params.longitude, req.params.latitude]
       },
       spherical: true,
       maxDistance: 10 * 1609,
       distanceField: 'distance'
     }
   }])
   .then(reviews =&gt; res.json(reviews))
   .catch(err =&gt; console.log(err))
});
</code></pre>
<p>The syntax for my query is based off the MongoDB documentation for $geoNear. Am I using this incorrectly with Mongoose?</p>

